import React from 'react';
import styled from 'styled-components';

function BookmarkPage() {
	return (
		<ComponentWrapper>
			<nav role="presentation" className="Nav_Nav__mBpI5">
				<h2 className="Nav_Nav_title__4b9t6">
					<p>북마크</p>
					<button type="button" className="Nav_Nav_button__NSodo">
						북마크
					</button>
				</h2>
			</nav>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	padding-bottom: 100px;
	margin: 0 auto;
	width: 87.72%;
	position: relative;
	max-width: 1060px;
	.Nav_Nav__mBpI5 {
		position: relative;

		line-height: normal;
		.Nav_Nav_title__4b9t6 > p {
			font-size: 20px;
			font-weight: 700;
			color: #333;
			padding: 50px 0 20px;
		}
	}
`;

export default BookmarkPage;
